    false,nt"url": null,nt"notes": "This annual narrative report for National
    Elk Refuge outlines Refuge accomplishments during the 1978 calendar year. The report
    begins with an introduction to the Refuge and information about weather conditions,
    habitat conditions, land acquisition activities, and the system status. Construction
    and maintenance are also described. Habitat management is covered; grasslands are
    discussed. The wildlife section of the report discusses endangered and threatened
    species, migratory birds, and mammals. Interpretation and recreation activities
    are outlined; topics include information and interpretation, recreation, and law
    enforcement. Field investigations, cooperative programs, items of interest, and
    safety information are attached.",nt"license_title": "License Not Specified",nt"extras":
